                    <text transform="matrix(1 0 0 1 29.1667 139.2419)"><tspan x="0" y="0" class="st7 st14 st15">Daniel Dumile (“doom-uh-lay”) is a </tspan><tspan x="0" y="11.4" class="st7 st14 st15">British born American hip-hop artist </tspan><tspan x="0" y="22.8" class="st7 st14 st15">who has taken on several stage </tspan><tspan x="0" y="34.2" class="st7 st14 st15">names in his career, most famously </tspan><tspan x="0" y="45.6" class="st7 st14 st15">MF DOOM (standing for metal </tspan><tspan x="0" y="57" class="st7 st14 st15">fingers/metal face doom). He has </tspan><tspan x="0" y="68.4" class="st7 st14 st15">also been known as Zev Love X, </tspan><tspan x="0" y="79.8" class="st7 st14 st15">King Geedorah, Metal Fingers, Viktor </tspan><tspan x="0" y="91.2" class="st7 st14 st15">Vaughn, Doom, and has appeared in </tspan><tspan x="0" y="102.6" class="st7 st14 st15">several collaborative projects such </tspan><tspan x="0" y="114" class="st7 st14 st15">as DANGERDOOM (with Danger </tspan><tspan x="0" y="125.4" class="st7 st14 st15">Mouse) and Madvillain (with </tspan><tspan x="0" y="136.8" class="st7 st14 st15">Madlib). Little is known about his </tspan><tspan x="0" y="148.2" class="st7 st14 st15">personal life. </tspan></text>
                </g>
